lastisitas meningkat, Hidrasi meningkat, Perfusi jaringan meningkat, Kerusakan jaringan/kerusakan lapisan kulit menurun, Membran mukosa kuning menurun', '', '', '', '', '', '', '', '', '1688', '1', 'Intervensi Keperawatan: Monitor adanya kelelahan otot bantu nafas, Monitor status respirasi dan oksigenisasi, Pertahankan kepatenan jalan nafas, Bantu untuk merubah posisi jika diperlukan, Lakukan auskultasi bunyi pernafasan secara teratur, Identifikasi keadaan emosional ibu saat akan dilakukan konseling menyusui, Identifikasi keinginan dan tujuan menyusui, Identifikasi permasalahan yang ibu alami selama proses menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu, Monitor ikterik pada sklera dan kulit bayi, Identifikasi kebutuhan cairan sesuai dengan usia gestasi dan berat badan, Monitor suhu dan tanda vital setiap 4 jam sekali, Monitor efek samping fototerapi (mis : hipertermi,diare,rush pada kulit,penurunan berat badan lebih dari 8  10 %<div>kolaborasi : R/ SHK (27 MEI 2025) ic (+) kertas saring (-), post tranfusi prc 20ml selama 4 jam,rencana minum 2ml/3jam ASI, inj paracetamol 20mg/6jam rutin selama 3-5hari ,inj vitamin K 1 mg im selama 3 hari ,inj phenobarbital 26mg loading dose (jam 12.00 sudah diberikan)inj phenobarbital 2mg/12jam (maintenance) dimulai 12 jam setelah dosis pertama atau jam 24.00, konsul SpJP untuk kemungkinan hsPDA, BLT 2x24jam tgl 13/5/25 jam 13.00 s/d tgl 15/5/25 jam 13.00 WIB.ganti  cairan racikan D10,90ml dan ca-gluconas1,3ml,rete 3,7 ml /jam</div>', NULL, '1688', 0, NULL, '2025-05-14 07:54:16')
